import React from "react";
import "./Body.css"
import SingleBlocks from "./SingleBlocks";

let comicSec=0;
let mandalaSec=0;    
let doodleSec=0;
let waterSec=0;
let sketchSec=0;

let comicTimer=0;
let mandalaTimer=0;
let doodleTimer=0;
let waterTimer=0;
let sketchTimer=0

let comicTimeStart = () => {
    comicTimer = setInterval(()=>{comicSec++},10000);
}

let comicTimeStop = () => {
    setTimeout(comicTimer);
}

let mandalaTimeStart = () => {
    mandalaTimer = setInterval(()=>{mandalaSec++},10000);
}

let mandalaTimeStop = () => {
    setTimeout(mandalaTimer);
}

let doodleTimeStart = () => {
    doodleTimer = setInterval(()=>{doodleSec++},10000);
}

let doodleTimeStop = () => {
    setTimeout(doodleTimer);
}

let waterTimeStart = () => {
    waterTimer = setInterval(()=>{waterSec++},10000);
}

let waterTimeStop = () => {
    setTimeout(waterTimer);
}

let sketchTimeStart = () => {
    sketchTimer = setInterval(()=>{sketchSec++},10000);
}

let sketchTimeStop = () => {
    setTimeout(sketchTimer);
}





const LinkList = [
{ Link: <img onMouseOver={comicTimeStart} onMouseOut={comicTimeStop} className="provided_image comic" src={require("./comic art/c1.jpg")}/>, key: "i1", id: "" },
{ Link: <img onMouseOver={doodleTimeStart} onMouseOut className="provided_image doodle" src={require("./doodle art/d1.jpg")}/>, key: "i2", id: "" },
{ Link: <img className="provided_image mandala" src={require("./mandala art/m1.jpg")}/>, key: "i3", id: "" },
{ Link: <img className="provided_image sketch" src={require("./sketch art/s1.jpg")}/>, key: "i4", id: "" },
{ Link: <img className="provided_image comic" src={require("./comic art/c3.jpg")}/>, key: "i5", id: "" },
{ Link: <img className="provided_image sketch" src={require("./sketch art/s2.jpg")}/>, key: "i6", id: "" },
{ Link: <img className="provided_image water" src={require("./watercolor painting/w4.jpg")}/>, key: "i7", id: "" },
{ Link: <img className="provided_image mandala" src={require("./mandala art/m4.jpg")}/>, key: "i8", id: "" },
{ Link: <img className="provided_image comic" src={require("./comic art/c2.jpg")}/>, key: "i9", id: "" },
{ Link: <img className="provided_image mandala" src={require("./mandala art/m2.jpg")}/>, key: "i10", id: "" },
{ Link: <img className="provided_image sketch" src={require("./sketch art/s3.jpg")}/>, key: "i11", id: "" },
{ Link: <img className="provided_image sketch" src={require("./sketch art/s4.jpg")}/>, key: "i12", id: "" },
{ Link: <img className="provided_image doodle" src={require("./doodle art/d2.png")}/>, key: "i13", id: "" },
{ Link: <img className="provided_image water" src={require("./watercolor painting/w1.jpg")}/>, key: "i14", id: "" },
{ Link: <img className="provided_image water" src={require("./watercolor painting/w3.jpg")}/>, key: "i15", id: "" },
{ Link: <img className="provided_image comic" src={require("./comic art/c4.jpg")}/>, key: "i16", id: "" },
{ Link: <img className="provided_image mandala" src={require("./mandala art/m3.jpg")}/>, key: "i17", id: "" },
{ Link: <img className="provided_image water" src={require("./watercolor painting/w2.jpg")}/>, key: "i18", id: "" },
{ Link: <img className="provided_image doodle" src={require("./doodle art/d3.jpg")}/>, key: "i19", id: "" },
{ Link: <img className="provided_image doodle" src={require("./doodle art/d4.jpg")}/>, key: "i20", id: "" },
{ Link: <img className="provided_image comic" src={require("./comic art/c5.jpg")}/>, key: "i21", id: "" },
]

const Body = () => {
    return (
        <div>
        <div className="backbody_div">

            {LinkList.map((list)=><SingleBlocks link = {list.Link} key = {list.key}></SingleBlocks>)}
            </div>
        </div>
    )
};

export default Body;
